description:
Roberta Gemma, has two roles in this new movie ATV.
Rich and famous actress and her sister just got out of prison with a crazy idea, kidnap her sister and replace her. Will he be able to fool the producer? But above all be able to deceive her husband? How will he react when he finds out the secrets that hides his sister? Find out in this thriller from the background morbid and sensual played by a wonderful and unique Roberta Gemma.

